import React from 'react';
import ReactDOM from 'react-dom';

const fname = "Harshit";
const lname = "Garg";
const num = 5;
const img1 = "https://picsum.photos/200/300";
const img2 = "https://picsum.photos/300/400";
const img3 = "https://picsum.photos/400/500";
const date = new Date().toLocaleDateString();
const time = new Date().toLocaleTimeString();
ReactDOM.render(
  <>
    <h1>{`my full name is ${fname} ${lname}`}</h1>
    <p>{`todays Date is ${date}`}</p>
    <p>{`Current time is ${time}`}</p>
    <h1 contentEditable="true">{`my last name is ${lname}.`}</h1>
    <img src={img1} alt="images" />
    <img src={img2} alt="images" />
    <img src={img3} alt="images" />
  </>,
  document.getElementById('root'));
